import React from 'react';
import Cell from './Cell'
import './Board.css';

function Board (props) {
        console.log(props)

        return (
        <div className="board"> 
          {props.currentGrid.map(row => {
                  row.map(cellColor => 
                        <Cell cellColor={cellColor}/>
                  )
          })}
        </div>
        )

}

export default Board;

Board.defaultProps = {
        currentColor: "#0000FF",
        currentGrid: [
                ["#FFFFFF", "#FFFFFF", "#FFFFFF", "#FFFFFF", "#FFFFFF"],
                ["#FFFFFF", "#FFFFFF", "#FFFFFF", "#FFFFFF", "#FFFFFF"],
